import React from 'react';
import ReactDOM from 'react-dom';
import { NavLink } from 'react-router-dom';
import shopBag from './../images/shop-bag.svg';
import './../styles/Navbar.css';
import Home from './Home';
import Cart from './Cartcontainer';

const Navbar = () => {

    return (

        <div>
            <div className="Nav-bar" >
                <div className="Logo">
                    <h2 className="Logo-text">Shopi</h2>
                </div>
                <div className="Cart-section">
                    <NavLink className="navbar-item" activeClassName="is-active" to="/">
                        Home
                    </NavLink>

                    <NavLink className="navbar-item" activeClassName="is-active" to="/cart" onClick={openNav} onLoad={setTimeout(closeNav,4000)}>
                        <img className="Cart-img" src={shopBag} alt="bagImage" />
                        Cart
                    </NavLink>

                    {/* <h3 className="Cart-text" onClick={showCart}>Cart</h3> */}
                </div>
            </div>

            <div id="mySidenav" class="sidenav">
            <span id="close" className="closeIcon" onClick={c}>&times;</span>
                <a href="#">About</a>
                <a href="#">Services</a>
                <a href="#">Clients</a>
                <a href="#">Contact</a>
            </div>

        </div>

    )
    function openNav() {
        document.getElementById("mySidenav").style.width = "100%";
      }

      /* Close/hide the sidenav */
      function closeNav() {
        document.getElementById("mySidenav").style.width = "0";
      }

}

export default Navbar;
